    data: |
      SELECT DISTINCT ( + 73 ) + - + ( - col2 ) - + - 7 * ( + col1 ) / - ( - col2 ) AS col2, col1 * + 29 AS col1 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
